i
export default function MainPage() {
  return (
    <div className='flex'>

      <LoginPage/>


          <Routes>
      <Route path="/" element={<LoginPage />} />

      <Route
        path="/dashboard"
        element={
          <PrivateRoute>
            {/* <DashboardPage /> */}
            <Sidebar/>

            <ContainerEntry/>
          </PrivateRoute>
        }
      />

      <Route path="*" element={<div>404 Not Found</div>} />
    </Routes>
    </div>

  );
}
